import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
    navContainer: {
        width: '100%'
    },
    navItem: {
        width: 75,
        '& a': {
            textDecoration: 'none'
        }
    }
})

export default useStyles
